end

function bBitwiseOr (bits1, bits2)
    newBits = {}
    i = 0
    
    while i <= #bits1 do
        if bits1[i] == bits2[i] and bits1[i] == 0 and bits2[i] == 0 then
            newBits[i] = 0
        else
            newBits[i] = 1
        end
        
        i = i + 1
    end
    
    return newBits
end

