function add_8b (rIndex, nn)
	sum = registers[rIndex] + nn

	registers[rIndex] = bitwiseAnd_8(sum, 0xff)
	setFlags((sum == 0), false, halfCarry_add_8(registers[rIndex], nn), (sum > 255))
end

